#include <stdio.h>
#include <string.h>
#include "stack.h"

size_t my_strlen(const char *pointer)
{
    size_t tempLength = 0;
    while (pointer[tempLength] != 0)
        tempLength++;
    return tempLength;
}

char *smallest_possible_number(const char *source, const int digits_to_delete)
{
    int length = my_strlen(source);
    int digits_to_remove = 0;
    if (length <= digits_to_delete)
        return "0";
    stack *s = createStack(length);
    stack *result = createStack(length);
    push(s, source[0]);
    for (int i = 1; i < length; i++)
    {
        if (!isStackEmpty(s))
        {
            while (top(s) > source[i] && digits_to_remove < digits_to_delete)
            {
                pop(s);
                digits_to_remove++;
            }
        }
        push(s, (int)source[i]);
    }
    while (digits_to_remove < digits_to_delete)
    {
        pop(s);
        digits_to_remove++;
    }
    if (isStackEmpty(s))
        return "0";
    while (!isStackEmpty(s))
        push(result, pop(s));
    while (top(result) == '0')
        pop(result);
    if (isStackEmpty(result))
        return "0";
    char *result_string = (char *)malloc(length * sizeof(char));
    for (int i = 0; i < length; i++)
    {
        result_string[i] = (char)pop(result);
        if (isStackEmpty(result))
        {
            result_string[i + 1] = '\0';
            break;
        }
    }
    return result_string;
    return "a";
}

int main()
{
    char *ok = "";
    printf("%d", strlen(smallest_possible_number(ok, 50000)));

    return 0;
}

